import MainNavigation from "./MainNavigation";
import { Outlet } from "react-router-dom";
import classes from "./RouteLayoute.module.css";

function RouteLayout() {
  return (
    <>
      <MainNavigation />
      <main className={classes.content}>
        <Outlet />
      </main>
    </>
  );
}
export default RouteLayout;
